import React from 'react';

class Friend extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <img src={this.props.pictureUrl} alt="Avatar" />
                </div>
                <div>{ this.props.name }</div>
            </div>
        );
    }
}

export default Friend;
